module Test3.Lexer
open Microsoft.FSharp.Text.Lexing
open Microsoft.FSharp.Text
open Microsoft.FSharp.Reflection

type token = 
  | EOF of string
  | KW_SELECT  of string
  | KW_FROM of string
  | KW_BEGIN of string
  | KW_END of string
  | STRING_CONST of string
  | DEC_NUMBER of string
  | IDENT of string
  | GLOBALVAR of string
  | GLOBALTEMPOBJ of string
  | LOCALVAR of string
  | TEMPOBJ of string
  | DOT of string
  | COMMA of string
  | OP_PLUS of string
  | OP_EQ of string
  | OP_MINUS of string
  | OP_DIV of string
  | LPAREN of string
  | RPAREN of string
  | LBRACKET of string
  | RBRACKET of string
  | SEMI of string
let getKwToken (name: string) = 
    let s = name.ToUpper()
    match s with
    | "SELECT"    -> KW_SELECT s
    | "FROM"      -> KW_FROM s
    | "BEGIN"     -> KW_BEGIN s
    | "END"       -> KW_END s
    | _           -> IDENT name

let comment_depth = ref 0
let startPos = ref Position.Empty
let str_buf = new System.Text.StringBuilder()

let appendBuf (str:string) = str_buf.Append(str) |> ignore
let clearBuf () = str_buf.Clear() |> ignore
  
let makeIdent notKeyWord (name:string) =
  let prefix = 
    if String.length name >=2 
    then name.[0..1] 
    else ""
  if prefix = "@@" then GLOBALVAR name
  else if prefix = "##" then GLOBALTEMPOBJ name
  else if name.[0] = '@' then LOCALVAR name
  else if name.[0] = '#' then TEMPOBJ name
  else if notKeyWord then IDENT name
  else getKwToken name

